import React from "react";
import { Row, Col, Button, Typography } from "antd";
import {
	WidthImg,
	Texty,
	Paragraphy,
	ActionBtn,
	Pp,
	FooterContainer,
} from "../assets/css/style_result";

function Footer() {
	return (
		<>
			<FooterContainer>
				<img
					src={require("../assets/images/result/ldd_burnt.png")}
					style={{
						marginTop: "30px",
						marginTop: "10vh",
						width: "66%",
					}}
				/>

				<Pp top={5} font={2}>
					귀여움이 세상을 구한다!
				</Pp>

				<Pp top={0} font={1} bottom={5}>
					라는 슬로건으로 러브둥둥 채널을 운영하며, <br /> 귀여운 모든
					것을 만화로 표현하고 있습니다.
				</Pp>

				<Pp top={5} font={1}>
					현재 NC 소프트의 버프툰에서 연재중이며, <br /> 「힝구의
					견생일기」, 「전 덕순인데요..」 등 여러 IP 시리즈를 보유하고
					있습니다.
				</Pp>
				<Pp top={5} font={1}>
					캐릭터 제작부터 웹툰, 애니메이션 제작까지 전반적인
					프로세스가 구축되어 있으니 <br /> 협업을 원하시는 분들은
					love@bigpicture.team 으로 문의 주세요!
				</Pp>
			</FooterContainer>

			<WidthImg
				src={require("../assets/images/result/line_horizontal.png")}
				style={{ marginBottom: "20px" }}
			/>

			<Pp
				top={10}
				font={1}
				style={{ textAlign: "left", fontWeight: "bold" }}
			>
				함께 만든 사람들
			</Pp>
			<Pp top={1} font={0.7} style={{ textAlign: "left" }}>
				기획 _ 러브둥둥 &nbsp;
				<a mailto="project@bigpicture.team">project@bigpicture.team</a>
			</Pp>
			<Pp font={0.7} style={{ textAlign: "left" }}>
				기획 _ 오지현 &nbsp;
				<a mailto="jeehyeon__@naver.com">jeehyeon__@naver.com</a>
			</Pp>
			<Pp font={0.7} style={{ textAlign: "left" }}>
				개발 _ 윤희상 &nbsp;
				<a mailto="huisang.growth@gmail.com">
					huisang.growth@gmail.com
				</a>
			</Pp>

			<div style={{ height: "30px", height: "30vh" }}></div>
		</>
	);
}

export default Footer;
